import express  from "express";
const router=express.Router();
import Nota from "../model/Equipo";

router.post('/equipo-nuevo', async (req,res)=>{
    const body=req.body;
    try {
        const notaDb=await Nota.create(body);
        res.status(200).json(notaDb)
    } catch (error) {
        return res.status(500).json({
            mensaje:'ocurrio un error',
            error
        
        })
    }
});

router.get('/equipo/_id', async(req, res) => {
    const _id = req.params.id;
    try {
    const notaDB = await Nota.findOne({_id});
    res.json(notaDB);
    } catch (error) {
    return res.status(400).json({
    mensaje: 'Ocurrio un error',
    error
    })
    }
   });

   router.get('/equipo', async(req, res) => {
    try {
    const notaDb = await Nota.find();
    res.json(notaDb);
    } catch (error) {
    return res.status(400).json({
    mensaje: 'Ocurrio un error',
    error
    })
    }
   });

   router.delete('/equipo/:id', async(req, res) => {
    const _id = req.params.id;
    try {
    const notaDb = await Nota.findByIdAndDelete({_id});
    if(!notaDb){
    return res.status(400).json({
    mensaje: 'No se encontró el id indicado',
    error
    })
    }
    res.json(notaDb);
    } catch (error) {
    return res.status(400).json({
    mensaje: 'Ocurrio un error',
    error
    })
    }
   });


   // Put actualizar una equipo
router.put('/equipo/:id', async(req, res) => {
    const _id = req.params.id;
    const body = req.body;
    try {
    const notaDb = await Nota.findByIdAndUpdate(
    _id,
    body,
    {new: true});
    res.json(notaDb);
    } catch (error) {
    return res.status(400).json({
    mensaje: 'Ocurrio un error',
    error
    })
    }
   });
   

module.exports =router;

