        res.status(200).json(equipoDB);
        
    } catch (error) {
    
        return res.status(500).json({
    
            mensaje:'Ocurrio un error',
            error
        })
        
    }
    
    
    });

router.get('/equipo/:id', async(req, res) => {
    const _id = req.params.id;
