    })
    }
    res.json(equipoDB);
    } catch (error) {
    return res.status(400).json({
    mensaje: 'Ocurrio un error',
    error
    })
    }
   });


   // Put actualizar una equipo
router.put('/equipo/:id', async(req, res) => {
